import { useContext } from "react";
import { Fragment, useEffect } from "react";
import ContactsContainer from "../Components/Contacts/ContactsContainer";
import ModuleActions from "../Components/Leads/LeadsActions";
import useForm from "../Hooks/useForm";
import AuthContext from "../Store/Auth/AuthContext";
import { getContactsFields } from "../Store/Contacts/contacts-actions";


const ContactsModule = () => {
    const {orgId} = useContext(AuthContext);
   const {isLoading, httpError, information, address, sendRequest} =  useForm(getContactsFields, false);

    useEffect(()=> {
        sendRequest(orgId);
    },[])

    return <Fragment>
                    <ModuleActions module="Contacts" path="add-contact"/>
                    <ContactsContainer contactCols={[]} contacts={[]}/>
         </Fragment>

}

export default ContactsModule;
